import { FaGithub, FaSnapchat, FaTwitter } from "react-icons/fa";
import { IoLogoInstagram } from "react-icons/io";

const SideBar = () => {
  return (
    <div className="fixed left-0 w-screen h-50 flex flex-row justify-center items-center">

        <SideBarIcon icon={<TiSocialLinkedin size="28" />} />
        <SideBarIcon icon={<FaGithub size="20" />} />
        <Divider />
        <SideBarIcon icon={<IoLogoInstagram size="20" />} />
        <SideBarIcon icon={<FaTwitter size="20" />} />

    </div>
  );
};

const SideBarIcon = ({ icon, text = 'tooltip ðŸ’¡' }) => (
  <div className="sidebar-icon group">
    {icon}
    <span class="sidebar-tooltip group-hover:scale-100">
      {text}
    </span>
  </div>
);


const Divider = () => <hr className="sidebar-hr" />;

export default SideBar;
